export interface IPaginator {
    /** Total number of pages */
    totalPages: number;
    /** Currently selected page */
    currentPage: number;
    /** Method that is activated when changing pages */
    onChangePage: (page: number) => void;
    /** Maximum number of pages displayed by Paginator. Minimum `5` */
    maxPagesToDisplay?: number;
    "data-testid"?: string;
}
